去麦当劳。一个看上去贼年轻的小哥哥接客。

           &#34;要一个那么大鸡翅。&#34;
           &#34;第二个半价喔，要不要多份&#34;
           &#34;不了不了，我一个人孤苦伶仃吃不完的。&#34;
           &#34;好吧......&#34;
           &#34;再要一个麦旋风。&#34;
           &#34;这个也第二个半价喔，对自己好一点吃多个啦&#34;
           .........
           &#34;再要个香蕉派。我知道第二个半价了！！吃不下！！就一个！！！&#34;
           
           我的天哪，麦当劳从哪找的这么尽职的小哥哥。(;¬_¬)

给大家推荐一部应该是纪录片的电影。
&lt;super siz me&gt;
讲的是九十年代一位小哥为了抵制麦当劳的超超大份，而作死连续一个月只吃麦当劳和采访调查麦当劳顾客和食物的故事，之前b站有资源的，应该是最近被清了，我再去找找av号。
